        public static void SeedExtra(EFDbContext _context, IHostingEnvironment _env, IConfiguration _conf)
        {
            if (_context.Extras.Count() <= 0)
            {
                List<Extra> extras = new List<Extra>();
                extras.Add(new Extra
                {
                    Name = "Кетчуп",
                    Description = "Кетчуп робить смак яскравішим",
                    Measuring = "50 грам",
                    Price = 10M,
                    Image = "https://harchi.info/files/2981-ketchup-and-potato.jpg"
                });
                extras.Add(new Extra
                {
                    Name = "Гірчиця",
                    Description = "Гірчиця робить смак яскравішим",
                    Measuring = "50 грам",
                    Price = 10M,
                    Image = "https://m.dom-eda.com/uploads/images/catalog/item/7f4e65cfc2/f674ed3b6f_500.jpg"
                });
                extras.Add(new Extra
                {
                    Name = "Сметана",
                    Description = "Сметана робить смак трішечки кислим",
                    Measuring = "50 грам",
                    Price = 10M,
                    Image = "https://www.yasno-product.com.ua/wa-data/public/shop/products/04/00/4/images/156/156.970.jpg"
                });
                string imageName, pathSaveImages, image;
                int counter = 0;
                string[] base64 =
                {
                    "data:image/jpeg;base64,",
                    "data:image/jpeg;base64,",
                    "data:image/jpeg;base64,"
                };
                foreach (var extra in extras)
                {
                    imageName = Guid.NewGuid().ToString() + ".jpg";
                    pathSaveImages = InitStaticFiles
                        .CreateImageByFileName(_env, _conf,
                        new string[] { "ImagesPath", "ImagesProductsPath" },
                        imageName, base64[counter]);

                    if (pathSaveImages != null)
                    {
                        image = imageName;
                        extra.Image = image;
                    }

                    _context.Extras.Update(extra);
                    counter++;
                }
                _context.SaveChanges();
            }
        }

